          <div>
            <div>
              <h1>Lleyton Morris</h1>
              <h2>Software Developement</h2>
              <div>
                <img src="" alt="test"/>
                <p>Insert Email</p>
              </div>
              <div></div>
              <div>
                <img src="" alt="test"/>
                <p>Insert Current Position</p>
              </div>
            </div>
          </div>
        </div>
      </li>
      <li>
        <img src={SpiceAndWolf} alt="test"/>
        <h1>Skill-Tree</h1>
      </li>
      <li >
        <img src={SpiceAndWolf} alt="test"/>
        <h1>Gravylang</h1>
      </li>
    </ol>
  )
}

const init = () => {
    return (
      <div id='init-div'>
        <div id="init-outer-center">
          <h1 id='init-h1'>Welcome</h1>
          <p id='init-p'>Press any button to continue</p>
        </div>
      </div>
    )
  }

export default Home;
